import React from 'react';

const HomePage: React.FC = () => (
    <div style={{ padding: '20px' }}>
        <h1>Bioinformatics Dashboard</h1>
        <p>Welcome! This dashboard will host your bioinformatics projects.</p>
    </div>
);

export default HomePage;
